import React from 'react';

class Login extends React.Component {
   constructor(props) {
      super(props);

      this.state = {
        ID: "",
         Username: "",
         passeword:"",


      }
      this.handleChangeuser = this.handleChangeuser.bind(this);
      this.handleChangepsw = this.handleChangepsw.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
   }




















   render() {
       const {Username,passeword,handleChangeuser,handleChangepsw} = this.props

      return (

         <div>
            <form onSubmit={this.handleSubmit}>
        <label>
          Username:
          <input type="text" value={Username} onChange={handleChangeuser} />
          Passeword:
          <input type="text" value={passeword} onChange={handleChangepsw} />
        </label>
        <input type="submit" value="Submit" />
      </form>
         </div>

      );
   }
}
export default Login;
